			function textToBase64Barcode(text){
			  var canvas = document.createElement("canvas");
			  JsBarcode(canvas, text, {
				format: "CODE128",
				ean128: true,
				//fontSize: 15,
				width: 4,
				height: 20,
				displayValue: false
			  }); 
			  return canvas.toDataURL("image/png");
			}
			
